import React, { useState, useEffect } from 'react';
import axiosInstance from '../api/axios';
import './PremiumManagerPages.css';

const TeamCalendar = () => {
  const [summary, setSummary] = useState(null);
  const [startDate, setStartDate] = useState(new Date(new Date().setDate(new Date().getDate() - 30)).toISOString().split('T')[0]);
  const [endDate, setEndDate] = useState(new Date().toISOString().split('T')[0]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  const fetchSummary = async () => {
    try {
      setLoading(true);
      const response = await axiosInstance.get('/attendance/summary', {
        params: { start: startDate, end: endDate }
      });
      setSummary(response.data);
    } catch (err) {
      setError(err.response?.data?.error || 'Failed to fetch summary');
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchSummary();
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, [startDate, endDate]);

  if (loading) return <div className="container"><p>Loading...</p></div>;

  return (
    <div className="container">
      <h1>Team Calendar & Summary</h1>

      {error && <div className="alert alert-error">{error}</div>}

      <div className="card">
        <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(150px, 1fr))', gap: '1rem', marginBottom: '1rem' }}>
          <div className="form-group">
            <label>Start Date</label>
            <input
              type="date"
              value={startDate}
              onChange={(e) => setStartDate(e.target.value)}
            />
          </div>
          <div className="form-group">
            <label>End Date</label>
            <input
              type="date"
              value={endDate}
              onChange={(e) => setEndDate(e.target.value)}
            />
          </div>
        </div>
      </div>

      {summary && (
        <>
          <div className="grid">
            <div className="stat-box success">
              <div className="stat-value">{summary.statusSummary.present}</div>
              <div className="stat-label">Total Present</div>
            </div>
            <div className="stat-box danger">
              <div className="stat-value">{summary.statusSummary.absent}</div>
              <div className="stat-label">Total Absent</div>
            </div>
            <div className="stat-box warning">
              <div className="stat-value">{summary.statusSummary.late}</div>
              <div className="stat-label">Total Late</div>
            </div>
            <div className="stat-box">
              <div className="stat-value">{summary.statusSummary.halfDay}</div>
              <div className="stat-label">Half Days</div>
            </div>
          </div>

          <div className="card">
            <div className="card-title">Department Summary</div>
            <div className="table-container">
              <table>
                <thead>
                  <tr>
                    <th>Department</th>
                    <th>Present</th>
                    <th>Absent</th>
                    <th>Late</th>
                    <th>Half Day</th>
                  </tr>
                </thead>
                <tbody>
                  {Object.entries(summary.departmentSummary).map(([dept, stats]) => (
                    <tr key={dept}>
                      <td>{dept}</td>
                      <td>{stats.present}</td>
                      <td>{stats.absent}</td>
                      <td>{stats.late}</td>
                      <td>{stats.halfDay}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </div>
        </>
      )}
    </div>
  );
};

export default TeamCalendar;
